import React from 'react';
import { useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { Button } from 'react-bootstrap';

function Parks() {
  const { activityName } = useParams();
  const [data, setData] = useState([{}]);

  useEffect((activityName) => {
    fetch(
      'https://developer.nps.gov/api/v1/activities/parks?q=' +
        { activityName } +
        '&api_key=pwVAaI7eyJ3qGEpakWoicbKA0kCPdzM6KVyeH2mB'
    )
      .then((res) => res.json())
      .then((data) => {
        setData(data);
      });
  }, []);

  return (
    <div>
      <h1>Showing Results for National Parks that Offer: {activityName}</h1>

      {typeof data.members === 'undefined' ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => (
          <div>
            <br></br>{' '}
            <Button key={i} onClick={() => ButtonPressed(member)}>
              {member}
            </Button>
          </div>
        ))
      )}
    </div>
  );
}

export default Parks;
